import AccessTimeIcon from "@material-ui/icons/AccessTime";
import CloseIcon from "@material-ui/icons/Close";

export class Showreminder extends Component {
  constructor(props) {
    super(props);

    this.state = {};
  }

  render() {
    return (
      <div>
        <div
          style={{
            Display: "flex",
            flexDirection: "row",
            justifyContent: "space-between",
            backgroundColor: "#c7c3bd",
            borderRadius: "3%",
          }}
        >

        </div>
      </div>
    );
  }
}

export default Showreminder;
